import React from 'react'
import datosHotel from '../datos_tarjeta_hoteles.json'
import datosCarrusel from '../carrusel.json'
import datosPaseos from '../datos_paseos.json'

import Hotel from '../hotel'

class Princess extends React.Component

{

    render() {
        return (
            <Hotel datosCarrusel={datosCarrusel.princess} datosPaseos ={datosPaseos.PlayaCarmen} video = {datosHotel.PlayaCarmen[0].video}/>
        )
        
    }

}

export default Princess
